sys_variable_value.value:
(function execute(inputs, outputs) {
    var includeScript = new AlertEnterprisePlatformAPIs();
    gs.info("record_number ::: "+inputs.record_number);
    gs.info("record_number ::: "+typeof(inputs.record_number));
    var output = includeScript.syncAlertRequestStatusByRequestNumber(inputs.record_number);
    gs.info("output ::: "+output);
    outputs.alert_request_status = JSON.parse(output);
})(inputs, outputs);

